import React, { Component } from "react";
import {
  ScatterChart,
  Scatter,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer
} from "recharts";

class DOA extends Component {
  state = {
    chart: {}
  };
  constructor(props) {
    super(props);
    this.state.chart = { msg: "test chart", osX: [], osY: [] };
  }

  render() {
    const data = [
      { x: 100, y: 200, z: 200 },
      { x: 120, y: 100, z: 260 },
      { x: 170, y: 300, z: 400 },
      { x: 140, y: 250, z: 280 },
      { x: 150, y: 400, z: 500 },
      { x: 110, y: 280, z: 200 }
    ];
    return (
      <div style={{ width: "95%", height: 400, padding: 24 }}>
        <ResponsiveContainer>
          <PieChart width={400} height={400}>
            <Pie
              data={data01}
              dataKey="value"
              cx={200}
              cy={200}
              outerRadius={60}
              fill="#8884d8"
            />
            <Pie
              data={data02}
              dataKey="value"
              cx={200}
              cy={200}
              innerRadius={70}
              outerRadius={90}
              fill="#82ca9d"
              label
            />
          </PieChart>
        </ResponsiveContainer>
      </div>
    );
  }
}

export default DOA;
